import React from 'react';
import './AboutMe.css'; // Import CSS specific to this component
import AboutMeItem from './AboutMeItem';
import iceland from './images/iceland.jpg'; // Replace with your image path

function AboutMe() {
  return (
    <div className='aboutme'>
      <h1>About Me</h1>
      <div className='aboutme__container'>
        <div className='aboutme__wrapper'>
            <ul className='aboutme__items'>
                <AboutMeItem
                    imageSrc={iceland}
                    title="UCSC Graduate"
                    subtitle="Major in Computer Science"
                    goal="Unleashing Innovation Through Code: Empowering Business Success with Proficiency, Passion, and Excellence"
                />
            </ul>
        </div>
      </div>
    </div>
  );
}

export default AboutMe;
